				_root.CameraZoom -= 1;
			}
		}
	} else {
		if (savezoom !== undefined) {
			if (_root.CameraZoom<savezoom) {
				_root.CameraZoom += 1;
			} else {
				savezoom = undefined;
			}
		}
	}
}

